import React, {useEffect} from 'react'
import Axios from 'axios'

const App = ()=>{
    useEffect(()=>{
        const gettodo = async()=>{
            await Axios({
                method: "GET",
                url: "http://127.0.0.1:8000"
            }).then(response => {
                console.log(response.data);
            })
        }
        gettodo()
    },[])
    return(
        <div>
            <h1>Hello World</h1>
        </div>
     )
}
export default App
